/* eslint-disable no-useless-constructor */
import React, { Component } from 'react'

class App extends Component {
  constructor(props)
  {
    super(props)
    this.state={
      name:"ram"
    }
  }
  clickHandle=()=>{
    this.setState.name=""
  }
  render() {
    return (
      <div style={{textAlign:"center"}} onClick={this.clickHandle}>{this.state.name}</div>
    )
  }
}

export default App
